import React from 'react'

export default function FullEventCard(props) {

    return (
        <div>
            {props.fullClassData.map(cl => {
                if(cl.classDate === props.currentDay) {
                    return (
                        <div>
                            <div>{props.fullClassData.classTitle}</div>
                            <div>
                                <div className="row">
                                    <label htmlFor="">Class Time</label><div>{props.fullClassData.classTime.hour}:{props.fullClassData.classTime.minutes}</div>
                                </div>
                            </div>
                        </div>
                    )
                }
            })}


            <button>Edit Class</button><button>Delete Class</button>
        </div>
    )
}
